  useEffect(() => {
    getMessages(token).then((res) => setMessages(res.data));
  }, [token]);

  return (
    <div>
      <h3>Messages</h3>
      <ul>
        {messages.map((m) => (
          <li key={m.id}>
            {m.sender} â†’ {m.receiver} : {m.content}
          </li>
        ))}
      </ul>
    </div>
  );
}
